const reducer = (
  state = { active: false, wrong: false, complete: false },
  action
) => {
  switch (action.type) {
    case "TEST_ON":
      return {...state,active:true};
    case "TEST_OFF":
      return false;
    default:
      return state;
  }
};

export default reducer;
